<!-- In the nested.html file, each group member should create 4 different 5 level deep nested tags (not counting the <html> and <body> as nested elements).
      So for example a very simple 2 level nested tag using an unordered list would look like: 
      <ul>
<li>first item</li>
</ul>
and three level nested tag with an ordered list might look like:
<ol><li><a href=index.html>home</a></li></ol>
-->

<!--Evan's Nested-->
<html>
    <head>
        <div>
            <h1>
                <ul>
                    <li>List Item 1</li>
                    <li>List Item 2</li>
                    <li>List Item 3</li>
                </ul>
            </h1>
        </div>
    </head>
    <head>
        <div>
            <ul>
                <li><div>Secondary Nested</div></li>
            </ul>
        </div>
    </head>
    <head>
        <div class = "row">
            <div class = "col-12">
                <div>
                    <p>This is a tester paragraph.</p>
                </div>
            </div>
        </div>
    </head>
</html>
